import styled from "styled-components";

export default styled.div`
    background-image: linear-gradient(white 1%, #3151D6);
    height: 60vh;
    width: 100%;
    border-radius: 0% 0% 40% 40% / 76% 76% 15% 15% ;
    bottom: 100px;
`;
